sap.ui.define(["sap/ui/core/mvc/Controller"],function(e){"use strict";return e.extend("com.amista.employeeapplication.controller.App",{onInit(){var e=this;this.getOwnerComponent().getModel().read("/checkRoleReturnId()",{success:function(o){console.log(o);if(o.checkRoleReturnId===0)e.getOwnerComponent().getRouter().navTo("RouteEmployeePortalView");else{e.getOwnerComponent().getRouter().navTo("RouteEmpPersonalView",{EMPID:o.checkRoleReturnId.EMPID})}},error:function(){console.log("You are saved!! Not an Employee!")}})}})});